
def ANDFLG(res, bits):
 mask = (1 << bits) - 1
 res &= mask
 n = 0
 for i in range(bits):
  if res & (1 << i):
   n += 1
 
 flg = 0x202
 
 if (n & 1) == 0:
  flg |= 4
 
 if res == 0:
  flg |= 0x40
 if res & (1 << (bits - 1)):
  flg |= 0x80
 
 return flg
 
def ROL(val, cnt, bits):
 mask = (1 << bits) - 1
 val &= mask
 return ((val << cnt) | (val >> (bits - cnt))) & mask

def ROR(val, cnt, bits):
 mask = (1 << bits) - 1
 val &= mask
 return ((val >> cnt) | (val << (bits - cnt))) & mask

def CLAMP(val, bits):
 return val & ((1 << bits) - 1)

def ASC(val):
 c = chr(val)
 if c not in "1234567890-=!@#$%^&*()_+~`QWERTYUIOP{}ASDFGHJKL:\"ZXCVBNM<>?qwertyuiop[]asdfghjkl;'zxcvbnm,./\\|":
  return "."
 return c

class AccessStack:
 base = None
 bits = 0
 def __init__(self, bits, cls):
  self.base = cls
  self.bits = bits
 
 def __getitem__(self, idx):
  if idx >= 0 and (idx + (self.bits // 8)) < len(self.base):
   return int.from_bytes(self.base[idx : idx + (self.bits // 8)], byteorder="little")
  else:
   return 0
 def __setitem__(self, key, val):
  if key < 0:
   raise IndexError
  if (key + (self.bits // 8)) >= len(self.base):
   self.bits.extend([0] * ((key + (self.bits // 8))-len(self.base)))
  
  self.base[key: key + (self.bits // 8)] = val.to_bytes(length = self.bits // 8, byteorder='little')


class VM:
 meme = None
 
 rbx = 0
 al = 0
 rsi = 0
 rbp = 0
 
 nextOp = -1
 ops = None
 run = False
 
 logtxt = None
 stack = None
 regs = None
 
 logi = 0
 
 def __init__(self):
  self.ops = dict()
  self.logtxt = list()
  self.stack = [0] * 0x2000
  self.regs = [0] * 0x200
  self.rbp = 0x1000
  self.meme = dict()
 
 def __getattr__(self, name):
  if name[:5] == "stack":
   return AccessStack(int(name[5]) * 8, self.stack)
  elif name[:3] == "reg":
   return AccessStack(int(name[3]) * 8, self.regs)
 
 def Mem(self, addr, sz = 0):
  if sz == 0:
   return self.meme[addr]
  
  tmp = [0] * sz
  for i in range(sz):
   if (addr + i) in self.meme:
    tmp[i] = self.meme[addr + i]
  return tmp
 
 def AddMem(self, addr, data):
  for i, b in enumerate(data):
   self.meme[addr + i] = b
  
   
 def log(self, l):
  self.logtxt.append(l)
  print("{:d}\t{}".format(self.logi, l))
  self.logi += 1
 
 def Op(self, num):
  f = None
  f = getattr(self, "op{:x}".format(num))
  f()
  
 def Start(self, off):
  self.rbp = off - 0xa0
  esi = self.stack4[self.rbp + 0xa0]
  esi ^= 0xFFFFFFFF
  esi += 1
  esi = (esi >> 24) | ((esi & 0xFF0000) >> 8) | ((esi & 0xFF00) << 8) | ((esi & 0xFF) << 24)
  self.log("Start at {:x}".format(esi))
  
  self.rsi = esi
  self.rbx = esi
  
  self.LoadOp()
  self.run = True
 
 def DerefMem(self, addr, sz, dflt = 0):
  if addr in range(len(self.stack)):
   return getattr(self, "stack{:d}".format(sz))[addr]
  if addr in self.meme:
   return int.from_bytes(self.Mem(addr, sz), byteorder="little")
  return dflt
 
 def LogStack(self, addr, sz, ascii = 1):
  l = ""
  asc = ""
  for i in range(sz):
   val = self.stack1[addr + i]
   if (i & 0xF) == 0:
    l = "{:04x}: {:02x}".format(addr + i, val)
    asc = ASC(val)
   else:
    l += " {:02x}".format(val)
    asc += ASC(val)
   
   if i == (sz - 1) or (i & 0xF) == 0xF:
    self.log("{} | {}".format(l, asc))
    
   

 def LoadOp(self):
  al = self.Mem( self.rsi - 1 )
  bl = self.rbx & 0xff
  al = (-(al - bl)) & 0xff
  al = (al + 10) & 0xff
  al = (al >> 1) | ((al & 1) << 7)
  bl = (bl - al) & 0xff
  self.rbx = (self.rbx & (~0xFF)) | bl
  
  self.rsi -= 1
  
  self.nextOp = al
  
