  if rax & 0x80000000:
   rax |= 0xFFFFFFFF00000000
  
  self.rsi -= 4
  
  self.log("LOAD {:x}".format(rax))
  
  self.rbp -= 8
  
  self.stack8[self.rbp] = rax
  
  self.LoadOp()
  
